-- This delete script remove the following data from the database it is run against.
--
-- * media
-- * transcriptions
-- * annotations
-- * case documents
-- * retentions
-- * audit
-- * notifications
-- * events
-- * cases
-- * hearings
-- * case people - defence, defendant, prosecutor, judge
--
-- It removes courthouses that are not included with the "prod" data.
-- It removes all courtrooms except for YORK 1, 2 and 199 and SWANSEA 31 and 32.
-- It removes associated all other courtrooms, node register entries and security group courthouse links.
--
-- It also re-sets the event_handler and retention_policy_type tables to the baseline set by the flyway scripts, as of 24 Sept 2024
--
-- Not deleted - the following are not deleted by this script
--
-- * the courthouses listed above, and their associated data such as security groups, courtrooms and node register
-- * user accounts
-- * security groups, roles and permissions and their associations with user accounts and the remaining courthouses
-- * event handlers (reset only)
-- * retention policy types (reset only)
-- * regions
-- * audit activities
-- * external location types
-- * external service auth token
-- * transcription statuses
-- * flyway history
-- * shedlock
-- * views or triggers
-- * files in blob storage

-- de-link everything
DELETE FROM darts.case_judge_ae;
DELETE FROM darts.case_transcription_ae;
DELETE FROM darts.hearing_annotation_ae;
DELETE FROM darts.hearing_event_ae;
DELETE FROM darts.hearing_judge_ae;
DELETE FROM darts.hearing_media_ae;
DELETE FROM darts.hearing_transcription_ae;
DELETE FROM darts.case_transcription_ae;
DELETE FROM darts.event_linked_case;

-- remove case people
DELETE FROM darts.defence;
DELETE FROM darts.defendant;
DELETE FROM darts.judge;
DELETE FROM darts.prosecutor;

-- remove media
DELETE FROM darts.external_object_directory;
DELETE FROM darts.transient_object_directory;
DELETE FROM darts.object_retrieval_queue;
DELETE FROM darts.transformed_media;
DELETE FROM darts.media_linked_case;
DELETE FROM darts.object_admin_action;
DELETE FROM darts.media;
DELETE FROM darts.media_request_aud;
DELETE FROM darts.media_request;

-- remove transcriptions
DELETE FROM darts.transcription_comment_aud;
DELETE FROM darts.transcription_comment;
DELETE FROM darts.transcription_document;
DELETE FROM darts.transcription_workflow_aud;
DELETE FROM darts.transcription_workflow;
DELETE FROM darts.transcription_aud;
DELETE FROM darts.transcription;

-- remove annotations
DELETE FROM darts.annotation_document;
DELETE FROM darts.annotation;

-- remove case documents
DELETE FROM darts.case_document;
DELETE FROM darts.case_overflow;

-- remove retentions;
DELETE FROM darts.case_retention;
DELETE FROM darts.case_management_retention;

--remove audit;
DELETE FROM darts.audit;
DELETE FROM darts.security_group_aud;
DELETE FROM darts.security_group_courthouse_ae_aud;
DELETE FROM darts.security_group_user_account_ae_aud;
DELETE FROM darts.user_account_aud;
DELETE FROM darts.courthouse_aud;
DELETE FROM darts.courthouse_region_ae_aud;
DELETE FROM darts.retention_policy_type_aud;

-- remove notifications;
DELETE FROM darts.notification;

-- remove events/cases/hearings
DELETE FROM darts.event;
DELETE FROM darts.hearing;
DELETE FROM darts.court_case;

-- remove non-linked tables
DELETE FROM darts.audit_heritage;
DELETE FROM darts.report;
DELETE FROM darts.daily_list;
DELETE FROM darts.revinfo;

-- remove from node register
DELETE FROM darts.node_register
WHERE ctr_id IN (
	SELECT ctr_id
	FROM darts.courtroom
	WHERE cth_id < 1 OR cth_id > 155
);

DELETE FROM darts.node_register
WHERE ctr_id IN (
	SELECT ctr_id
	FROM darts.courtroom
	WHERE cth_id NOT IN (127, 151) -- YORK/SWANSEA
);

DELETE FROM darts.node_register
WHERE ctr_id IN (
	SELECT ctr_id
	FROM darts.courtroom
	WHERE (
		(
			cth_id = 151 AND courtroom_name NOT IN ('1', '2', '199') -- YORK
		) OR (
			cth_id = 127 AND courtroom_name NOT IN ('31', '32') -- SWANSEA
		)
	)
);

-- remove courtrooms
DELETE FROM darts.courtroom
WHERE cth_id < 1 OR cth_id > 155;

DELETE FROM darts.courtroom
WHERE cth_id NOT IN (127, 151); -- YORK/SWANSEA

DELETE FROM darts.courtroom
WHERE cth_id = 151 -- YORK
AND courtroom_name NOT IN ('1', '2', '199');

DELETE FROM darts.courtroom
WHERE cth_id = 127 -- SWANSEA
AND courtroom_name NOT IN ('31', '32');

-- remove security_group_courthouse_ae
DELETE FROM darts.security_group_courthouse_ae
WHERE cth_id < 1 OR cth_id > 155;

-- remove courthouse region
DELETE FROM darts.courthouse_region_ae_aud;
DELETE FROM darts.courthouse_region_ae
WHERE cth_id < 1 OR cth_id > 155;

-- remove courthouses
DELETE FROM darts.courthouse
WHERE cth_id < 1 OR cth_id > 155;

-- reset retention policy types
DELETE FROM darts.retention_policy_type;

-- reset event handlers
DELETE FROM darts.event_handler;
